import {useState} from 'react';
import {Link} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import RandomComp from './RandomComp';

function Contact(props){
    const { name } = props; // Destructure the prop
    const [tfvar, setTF] = useState(false);
    const handleClick = () => {
        setTF(tfvar!=tfvar);
    }
    return (
    <div>
        <Routes>
            <Route path="/contact/random" element={<RandomComp />} />
        </Routes>
        <p>{name}</p>
        <p>this is the contact page</p>
        <Link to path='/contact/random' onClick ={handleClick}>Random</Link>
    </div>
    );
}
export default Contact;
